template <size_t N, size_t M, typename T>
int find_best_path_internal(const std::array<std::array<T, N>, M> &data) {
typedef std::tuple<int, int, uint64_t> key_type;
  std::priority_queue<key_type, std::vector<key_type>, decltype([](auto x, auto y){return std::get<2>(x) > std::get<2>(y);})> stack;
  stack.push({1,1,0});
  std::array<std::array<bool, N>, M> visited;
  std::fill(&visited[0][0], &visited[N-1][M-1], false);

  while (true) {
    auto [x,y,cost] = stack.top();
    stack.pop();
    if (x == 0 || y == 0 || x == N-1 || y== M-1) {
      continue;
      }
    if (x == N-2 && y == M-2) {
      return cost;
      }
    else {
      if (visited[x][y] == false)
      {
        stack.push({x, y+1, data[x][y+1]+cost});
        stack.push({x, y-1, data[x][y-1]+cost});
        stack.push({x-1, y, data[x-1][y]+cost});
        stack.push({x+1, y, data[x+1][y]+cost});
        visited[x][y] = true;
      }
    }
  }
}

template <size_t N, size_t M, typename T>
int find_best_path_wrapped(const std::array<std::array<T,N>, M> & data) {

  auto wrapped_data = std::make_unique<std::array<std::array<T, N+2>, M+2>>();
  for (size_t i = 0; i < N; ++i) {
    for (size_t j = 0; j < M; ++j) {
        (*wrapped_data)[i+1][j+1] = data[i][j];
      }
    }
  return find_best_path_internal(*wrapped_data);
  }

template <size_t N, size_t M, typename T>
int find_best_path_repeated(const std::array<std::array<T,N>, M> & data) {
  auto repeated_data = std::make_unique<std::array<std::array<T, 5*N+2>, 5*M+2>>();
  for (size_t i = 0; i < N; ++i) {
    for (size_t j = 0; j < M; ++j) {
      auto value = data[i][j];
        (*repeated_data)[i+1][j+1] = value;

      value = (data[i][j] + 1);
      if (value > 9) value -= 9;
        (*repeated_data)[i+1][j+1 + M] = value;
        (*repeated_data)[i+1+N][j+1] = value;

      value = (data[i][j] + 2);
      if (value > 9) value -= 9;
        (*repeated_data)[i+1+2*N][j+1] = value;
        (*repeated_data)[i+1+1*N][j+1+1*M] = value;
        (*repeated_data)[i+1][j+1+2*M] = value;

      value = (data[i][j] + 3);
      if (value > 9) value -= 9;
        (*repeated_data)[i+1+3*N][j+1+0*M] = value;
        (*repeated_data)[i+1+2*N][j+1+1*M] = value;
        (*repeated_data)[i+1+1*N][j+1+2*M] = value;
        (*repeated_data)[i+1+0*N][j+1+3*M] = value;

      value = (data[i][j] + 4);
      if (value > 9) value -= 9;
        (*repeated_data)[i+1+4*N][j+1+0*M] = value;
        (*repeated_data)[i+1+3*N][j+1+1*M] = value;
        (*repeated_data)[i+1+2*N][j+1+2*M] = value;
        (*repeated_data)[i+1+1*N][j+1+3*M] = value;
        (*repeated_data)[i+1+0*N][j+1+4*M] = value;

      value = (data[i][j] + 5);
      if (value > 9) value -= 9;
        (*repeated_data)[i+1+4*N][j+1+1*M] = value;
        (*repeated_data)[i+1+3*N][j+1+2*M] = value;
        (*repeated_data)[i+1+2*N][j+1+3*M] = value;
        (*repeated_data)[i+1+1*N][j+1+4*M] = value;

      value = (data[i][j] + 6);
      if (value > 9) value -= 9;
        (*repeated_data)[i+1+4*N][j+1+2*M] = value;
        (*repeated_data)[i+1+3*N][j+1+3*M] = value;
        (*repeated_data)[i+1+2*N][j+1+4*M] = value;

      value = (data[i][j] + 7);
      if (value > 9) value -= 9;
        (*repeated_data)[i+1+4*N][j+1+3*M] = value;
        (*repeated_data)[i+1+3*N][j+1+4*M] = value;

      value = (data[i][j] + 8);
      if (value > 9) value -= 9;
        (*repeated_data)[i+1+4*N][j+1+4*M] = value;
      }
    }
  return find_best_path_internal(*repeated_data);
  }

